<style>
    @import url('https://fonts.googleapis.com/css2?family=Bebas+Neue&display=swap');

    * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
        /* font-family: 'Poppins', sans-serif; */
    }

    /* hide scroll bar */
    ::-webkit-scrollbar {
        display: none;
    }

    /*  scroll snap */
    html {
        scroll-behavior: smooth;
    }

    .valeurs {
        width: 100vw;
        /* height: 100vh; */
        background-size: cover;
        background-position: center;
        background-repeat: no-repeat;
        position: relative;
        overflow: hidden;
    }

    .valeurs .valeus-section {
        width: 100%;
        height: 100vh;
        /* brush.png */
        background-image: url({{ asset('imgs/brush.png') }});
        background-size: cover;
        background-position: center;
        background-repeat: no-repeat;
        background-size: 35%;
        position: relative;
        display: flex;
        align-items: center;
        justify-content: center;

    }

    #NOS_VALEURS {
        width: 60%;
        transform: translate(20%, 0);
    }

    #arrow {
        animation: arrow 1s infinite;
    }

    @keyframes arrow {
        0% {
            transform: translateY(0);
        }

        50% {
            transform: translateY(10px);
        }

        100% {
            transform: translateY(0);
        }
    }

    #svg_autonomie {
        height: 80vh;
        width: 100%;
    }
    #text_autonomie{
      position: absolute;
      top: 50%;
      left: 65%;
      transform: translate(-50%, -50%);
      width: 55%;
    }

    svg{
        overflow: visible;
    }

    /* #brain{
      transform: translate(130px, 30px);
   }
   #autonomie{
      transform: translate(520px, 315px);
   }*/
   .bub{
      position: absolute;
      width: 450px;
      height: 450px;
      z-index: -1;
   }
   .img_top{
      top: 0;
      right: 0;
      transform: translate(50%,-25%);
      animation: rotate1 10s infinite;
   }
   .img_mid{
      top: 50%;
      /* left: 50%; */
      transform: translate(-50%,0%);
      animation: rotate2 10s infinite;
   }
   .img_bottom{
      bottom: 0;
      right: 0;
      transform: translate(50%,0%);
      animation: rotate3 10s infinite;
   }
   @keyframes rotate1 {
      0% {
         transform: translate(50%,-25%) rotate(0deg);
      }
      50% {
         transform: translate(50%,-25%) rotate(180deg);
      }
      100% {
         transform: translate(50%,-25%) rotate(360deg);
      }
   }
   @keyframes rotate2 {
      0% {
         transform: translate(-50%,0%) rotate(0deg);
      }
      50% {
         transform: translate(-50%,0%) rotate(180deg);
      }
      100% {
         transform: translate(-50%,0%) rotate(360deg);
      }
   }
   @keyframes rotate3 {
      0% {
         transform: translate(50%,0%) rotate(0deg);
      }
      50% {
         transform: translate(50%,0%) rotate(180deg);
      }
      100% {
         transform: translate(50%,0%) rotate(360deg);
      }
   }
   .Chess,#PassionSvg{
      height: 80vh;
   }
   #text_force{
      position: absolute;
      top: 40%;
      left: 45%;
      transform: translate(-50%, -50%);
      z-index: 3;
   }
   #text_resistance{
      position: absolute;
      right: 0;
      height: 270px;
      transform: translate(-95px, 228px);
   }

   @media screen and (max-width:550px) {
      #text_autonomie{
            width: 60%;
            left: 60%;
      }
      #text_force{
            width: 60%;
            left: 60%;
      }
      #text_resistance{
            width: 70%;
            left: 40%;
            transform: translate(-50%,0);
      }

      .img_top{
         width: 300px;
         height: 300px;
         transform: translate(50%,-25%);
      }
      .img_mid{
         width: 300px;
         height: 300px;
         transform: translate(-50%,0%);
      }
      .img_bottom{
         width: 300px;
         height: 300px;
         transform: translate(50%,0%);
      }
      .valeurs .valeus-section{
            height:50vh;
      }
      
      #PassionSvg{
         height: auto;
         width: 50vw;
      }
      .Chess{
         height: auto;
         width: 50vw;
         transform: translate(70px, 0px);
      }

   }

</style>
